import React, { useEffect } from "react";

const App = () => {
  useEffect(() => {
    const inputRange = document.querySelector('input[type="range"]');
  });

  return (
    <>
      <input
        type="range"
        id="nbreInput"
        min="2"
        max="10"
        value="2"
        onInput={(document.querySelector("displayOne").value = this.value)}
      />
      <input type="text" value="2" id="displayOne" readOnly />
      <input type="checkbox" name="" id="ok" />

      <label htmlFor="ok">CHECK</label>
      <h1>
        Hello guy <span className="si"></span>
      </h1>
    </>
  );
};

export default App;
